import React from "react";
import ReactDOM from "react-dom";
function Showstudentfees()
{
    fetch("http://localhost:3000/showstudentfees", {
          method: "GET",
          headers: {
            Accept: "application/json",
            "Content-Type": "application/json",
            "Access-Control-Allow-Headers": "Content-Type",
            "Access-Control-Allow-Methods": "GET, POST, PUT, DELETE, OPTIONS",
            "Access-Control-Allow-Origin": "*"
          },
        //   body: JSON.stringify(user)
        })
          .then(res => res.json())
          .then(data => {
            console.log(data.length);
            // window.location.replace("login.js");
            // alert("success");
            var p=`<tr>
            <th scope="row">1</th>
            <td>`+data[0].name+`</td>
            <td>Doe</td>
            <td>jhon@email.com</td>
            <td>USA</td>
            <td>123</td>
            <td>Member</td>
        </tr>
        `;
        const names = ["whale", "squid", "turtle", "coral", "starfish"];

const NamesList = () => (
  <div>
    <ul>{names.map(name => <li key={name}> {name} </li>)}</ul>
  </div>
);

const rootElement = document.getElementById("show");
ReactDOM.render(<NamesList />, rootElement);
        //    document.getElementById("show").innerHTML=p;
          })
          .catch(err => console.log(err));
    
      
    
  

    return (
       <div>
           <div class="container pt-4 ">
                <div class="row g-4">
            
           <div class="col-12">
                        <div class="bg-secondary rounded h-100 p-4">
                            <h6 class="mb-4">Responsive Table</h6>
                            <div class="table-responsive">
                                <table class="table">
                                    <thead>
                                        <tr>
                                            <th scope="col">#</th>
                                            <th scope="col">First Name</th>
                                            <th scope="col">Last Name</th>
                                            <th scope="col">Email</th>
                                            <th scope="col">Country</th>
                                            <th scope="col">ZIP</th>
                                            <th scope="col">Status</th>
                                        </tr>
                                    </thead>
                                    <tbody id="show">
                                        <tr>
                                            <th scope="row">1</th>
                                            <td>John</td>
                                            <td>Doe</td>
                                            <td>jhon@email.com</td>
                                            <td>USA</td>
                                            <td>123</td>
                                            <td>Member</td>
                                        </tr>
                                        <tr>
                                            <th scope="row">2</th>
                                            <td>Mark</td>
                                            <td>Otto</td>
                                            <td>mark@email.com</td>
                                            <td>UK</td>
                                            <td>456</td>
                                            <td>Member</td>
                                        </tr>
                                        <tr>
                                            <th scope="row">3</th>
                                            <td>Jacob</td>
                                            <td>Thornton</td>
                                            <td>jacob@email.com</td>
                                            <td>AU</td>
                                            <td>789</td>
                                            <td>Member</td>
                                        </tr>
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </div>

       </div>
       </div>
       </div>

        
       
    );
}

export default Showstudentfees;
